DROP TABLE IF EXISTS `Communication`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `Communication` (
  `ComID` int NOT NULL AUTO_INCREMENT,
  `Sender` varchar(45) NOT NULL,
  `Recipient` varchar(45) NOT NULL,
  `Content` varchar(255) NOT NULL,
  `SentDate` date NOT NULL,
  `SentTime` time NOT NULL,
  `IfRead` tinyint NOT NULL DEFAULT '0',
  PRIMARY KEY (`ComID`),
  KEY `From_idx` (`Sender`),
  KEY `To_idx` (`Recipient`),
  CONSTRAINT `From` FOREIGN KEY (`Sender`) REFERENCES `User` (`Email`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `To` FOREIGN KEY (`Recipient`) REFERENCES `User` (`Email`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=686 DEFAULT CHARSET=utf8mb3;
